import React, { Component } from 'react'

class UnAnsQuestion extends Component {
    render() {
        console.log("inside question", this.props.obj);

        return (
            <ul>
                <li>would you rather</li>
                <li>{this.props.obj.optionOne.text}</li>
                <li>{this.props.obj.optionTwo.text} </li>
                <li>
                    <button>vote</button>
                </li>
            </ul>
        )
    }
}

export default UnAnsQuestion
